Privacy Policy






What information do we collect?



We collect information from you when you register on our site. When ordering or registering on our site, as
appropriate, you may be asked to enter your: name, e-mail address, phone number or credit card information.
You may, however, visit our site anonymously.









What do we use your information for?


Any of the information we collect from you may be used in one of the following ways:

To personalize your experience (your information helps us to better respond to your individual needs)

To improve our website (we continually strive to improve our website offerings based on the information
and feedback we receive from you)

To process transactions (your information, whether public or private, will not be sold, exchanged,
transferred, or given to any other company for any reason whatsoever, without your consent, other than for
the express purpose of delivering the purchased product or service requested)

To send periodic emails (the email address you provide for order processing, will only be used to send
you information and updates pertaining to your order)










How do we protect your information?


We implement a variety of security measures to maintain the safety of your personal information when you place
an order. We offer the use of a secure server. All supplied sensitive/credit information is transmitted via
Secure Socket Layer (SSL) technology and then encrypted into our Payment gateway providers database only to be
accessible by those authorized with special access rights to such systems, and are required to keep the
information confidential. After a transaction, your private information (credit cards, social security
numbers, financials, etc.) will not be stored on our servers.








Do we disclose any information to outside
parties?


We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information. This
does not include trusted third parties who assist us in operating our website, conducting our business, or
servicing you, so long as those parties agree to keep this information confidential. We may also release your
information when we believe release is appropriate to comply with the law, enforce our site policies, or
protect ours or others rights, property, or safety. However, non-personally identifiable visitor information
may be provided to other parties for marketing, advertising, or other uses.








Third party links



Occasionally, at our discretion, we may include or offer third party products or services on our website.
These third party sites have separate and independent privacy policies. We therefore have no responsibility
or liability for the content and activities of these linked sites. Nonetheless, we seek to protect the
integrity of our site and welcome any feedback about these sites.


We use third parties to gather your data from financial institutions. By using our service, you grant out
third-party provider(s) the right, power, and authority to act on your behalf to access and transmit your
personal and financial information from the relevant financial institution according to terms of our
third-party provider's privacy policy (including Plaid's privacy policy located at
https://plaid.com/legal).









Childrens Online Privacy Protection Act
Compliance


We are in compliance with the requirements of COPPA (Childrens Online Privacy Protection Act), we do not
collect any information from anyone under 13 years of age. Our website, products and services are all directed
to people who are at least 13 years old or older.








Online Privacy Policy Only


This online privacy policy applies only to information collected through our website and not to information
collected offline.
The Buildzoom website uses cookies, tracking pixels and related technologies. Cookies are small data files
that are served by our
platform and stored on your device. Our site uses cookies dropped by us or third parties for a variety of
purposes including to
operate and personalize the website. Also, cookies may also be used to track how you use the site to target
ads to you on other websites.









Your Consent


By using our site, you consent to our privacy policy.








Changes to our Privacy Policy


If we decide to change our privacy policy, we will post those changes on this page.









